import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Switch, Route, Link } from 'react-router-dom';
export default function VizNavigation() {

  return (
    <div id="navigation-viz">
    <Navbar expand="lg" className="navbar-form navbar-fixed-top">
      <Container>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
              <Nav.Link as={Link} to={`/`} >Home</Nav.Link>
            {<NavDropdown title="Explanatory Variable (e.g. Time)" id="basic-nav-dropdown">
              <NavDropdown.Item as={Link} to={`cat-example`}>Over Time (since 2001)</NavDropdown.Item>
            </NavDropdown>}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
            {/*
              <NavDropdown title="Crime Rate by Area">
            <NavDropdown.Item href="example-layout">Crime Data by Zip Code in Chicago Last Year</NavDropdown.Item>
            <NavDropdown.Item href="example-layout">Neighborhoods by Year and Crime Rate</NavDropdown.Item>
          </NavDropdown>}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
       */}
            </div>
  );
}
